                            <textarea class="summernote" name="long_post" placeholder="Enter Full Description" required="" style="display: none;">&lt;p&gt;When you're facing heart or vascular issues, the last thing on your mind should be how to navigate your care. Overlake's David and Shelley Hovind Heart &amp;amp; Vascular Center brings cardiac and vascular services together in one location. Our new 19,200-square-foot facility features the most advanced cardiovascular equipment and technology available on the Eastside.as&lt;/p&gt;&lt;p&gt;The &lt;b&gt;cardiovascular centre&lt;/b&gt;&amp;nbsp;is a part of the human brain responsible for the regulation of the rate at which the heart beats through the nervous and endocrine systems. It is found in the medulla oblongata. Normally, the heart beats without nervous control, but in some situations (e.g., exercise, body trauma), the cardiovascular centre is responsible for altering the rate at which the heart beats. It also mediates respiratory sinus arrhythmia.&lt;/p&gt;&lt;p style="text-align: justify; "&gt;The &lt;b&gt;cardiovascular centre&lt;/b&gt; is a part of the human brain responsible for the regulation of the rate at which the heart beats through the nervous and endocrine systems. It is found in the medulla oblongata. Normally, the heart beats without nervous control, but in some situations (e.g., exercise, body trauma), the cardiovascular centre is responsible for altering the rate at which the heart beats. It also mediates respiratory sinus arrhythmia.&lt;/p&gt;&lt;p style="text-align: justify; "&gt;&lt;img src="http://pepdev.com/theme-preview/klinikal/public/uploads/service-7.jpg" style="width: 50%; float: right;"&gt;&lt;/p&gt;&lt;ol&gt;&lt;li&gt;&lt;span style="text-align: center;"&gt;At vero eos et accusamus et iusto odio dignissimos&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;span style="text-align: center;"&gt;ducimus qui blanditiis praesentium voluptatum deleniti&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;span style="te